import { __decorate } from "tslib";
import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';
import { CoreCommonModule } from '@core/common.module';
import { ListProviderComponent } from './list-provider/list-provider.component';
import { SaveProviderComponent } from './save-provider/save-provider.component';
import { CommonModule } from '@angular/common';
import { CoreDirectivesModule } from '@core/directives/directives';
import { NgxDatatableModule } from '@swimlane/ngx-datatable';
import { FormsModule } from '@angular/forms';
import { CorePipesModule } from '@core/pipes/pipes.module';
import { NgbModule } from '@ng-bootstrap/ng-bootstrap';
import { NgSelectModule } from '@ng-select/ng-select';
import { CoreSidebarModule } from '@core/components';
import { InvoiceListService } from './list-provider/invoice-list.service';
import { InvoiceAddService } from './save-provider/invoice-add.service';
import { NewUserSidebarComponent } from './list-provider/new-user-sidebar/new-user-sidebar.component';
const routes = [
    {
        path: '',
        component: ListProviderComponent,
        data: { animation: 'sample' }
    },
    {
        path: 'salvar',
        component: SaveProviderComponent,
        data: { animation: 'home' }
    }
];
let ProviderModule = class ProviderModule {
};
ProviderModule = __decorate([
    NgModule({
        declarations: [
            ListProviderComponent,
            SaveProviderComponent,
            NewUserSidebarComponent,
        ],
        imports: [
            NewUserSidebarComponent,
            CommonModule,
            RouterModule.forChild(routes),
            CoreCommonModule,
            CoreDirectivesModule,
            NgxDatatableModule,
            FormsModule,
            CorePipesModule,
            NgbModule,
            NgSelectModule,
            CoreSidebarModule
        ],
        exports: [ListProviderComponent, SaveProviderComponent],
        providers: [InvoiceListService, InvoiceAddService]
    })
], ProviderModule);
export { ProviderModule };
